import React from 'react'
import { StyleSheet, View} from 'react-native'



export default AppCard = props => <View style={ {...styles.default, ...props.style} }>
    {props.children}
</View>


const styles = StyleSheet.create({
    default: {

        padding: 20,
        //borderWidth: 2,
        //borderColor: 'green',
        flexDirection: 'row',
        justifyContent: "space-between",
        alignItems: 'center',
        elevation: 8,
        shadowColor:'#000',
        shadowRadius: 2,
        shadowOpacity: 0.3,
        shadowOffset:{ width: 2, height: 2 },
        backgroundColor: '#fff',
        borderRadius: 10,

    }

})
